css:
atom-text-editor,
:host {
  background-color: #f3f3f3;
  color: #656565;
  font-weight: 300;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: #656565;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #f3f3f3;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #f3f3f3;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #dfebef;
  color: #656565;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: #f3f3f3;
  color: #656565;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #656565;
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #969896;
}
atom-text-editor .invisible,
:host .invisible {
  color: #656565;
}
atom-text-editor .cursor,
:host .cursor {
  color: #0073a5;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #5dcafc;
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #969896;
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  border: 1px solid #ffffff;
}
.comment {
  color: #969896;
}
.keyword {
  color: #b294bb;
}
.keyword.control {
  color: #b294bb;
}
.keyword.operator {
  color: #656565;
}
.keyword.other.special-method {
  color: #81a2be;
}
.keyword.other.unit {
  color: #0b3ed3;
}
.storage {
  color: #b294bb;
}
.constant {
  color: #1d1f21;
}
.constant.character.escape {
  color: #8abeb7;
}
.constant.numeric {
  color: #0b3ed3;
}
.constant.other.color {
  color: #8abeb7;
}
.constant.other.symbol {
  color: #b5bd68;
}
.variable {
  color: #0b78dd;
}
.variable.interpolation {
  color: #bf4040;
}
.variable.parameter.function {
  color: #656565;
}
.invalid.illegal {
  background-color: #cc6666;
  color: #f3f3f3;
}
.string {
  color: #b5bd68;
}
.string.regexp {
  color: #8abeb7;
}
.string.regexp .source.ruby.embedded {
  color: #de935f;
}
.string.other.link {
  color: #cc6666;
}
.punctuation.definition.comment {
  color: #969896;
}
.punctuation.definition.string,
.punctuation.definition.variable,
.punctuation.definition.parameters,
.punctuation.definition.array {
  color: #656565;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #81a2be;
}
.punctuation.definition.bold {
  color: #f0c674;
  font-weight: bold;
}
.punctuation.definition.italic {
  color: #b294bb;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #bf4040;
}
.support.class {
  color: #0b3ed3;
}
.support.function {
  color: #8abeb7;
}
.support.function.any-method {
  color: #81a2be;
}
.entity.name.function {
  color: #81a2be;
}
.entity.name.type {
  color: #f0c674;
  text-decoration: underline;
}
.entity.other.inherited-class {
  color: #b5bd68;
}
.entity.name.class,
.entity.name.type.class {
  color: #0b3ed3;
}
.entity.name.section {
  color: #81a2be;
}
.entity.name.tag {
  color: #cc6666;
  text-decoration: underline;
}
.entity.other.attribute-name {
  color: #0b3ed3;
}
.entity.other.attribute-name.id {
  color: #81a2be;
}
.meta.class {
  color: #f0c674;
}
.meta.link {
  color: #0b3ed3;
}
.meta.require {
  color: #81a2be;
}
.meta.selector {
  color: #b294bb;
}
.meta.separator {
  background-color: #f3f3f3;
  color: #656565;
}
.none {
  color: #656565;
}
.markup.bold {
  color: #009bc6;
  font-weight: bold;
}
.markup.changed {
  color: #b294bb;
}
.markup.deleted {
  color: #cc6666;
}
.markup.italic {
  color: #009bc6;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #81a2be;
}
.markup.inserted {
  color: #b5bd68;
}
.markup.list {
  color: #cc6666;
}
.markup.quote {
  color: #0b3ed3;
}
.markup.raw.inline {
  color: #b5bd68;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #b5bd68;
}
atom-text-editor[mini] .scroll-view,
:host([mini]) .scroll-view {
  padding-left: 1px;
}
.heading.markup.md {
  color: #009bc6;
  font-weight: bold;
}
.unordered.list.markup.md,
.ordered.list.markup.md {
  color: #0073a5;
}
.unordered.list.markup.md .punctuation.md,
.ordered.list.markup.md .punctuation.md {
  color: #009bc6;
  margin-left: -1.5%;
}
.unordered.list.markup.md .strong.md,
.unordered.list.markup.md .strong.md .punctuation.md,
.ordered.list.markup.md .strong.md,
.ordered.list.markup.md .strong.md .punctuation.md,
.unordered.list.markup.md .italic.md,
.unordered.list.markup.md .italic.md .punctuation.md,
.ordered.list.markup.md .italic.md,
.ordered.list.markup.md .italic.md .punctuation.md {
  margin-left: 0;
}
.unordered.list.markup.md .link.markup.md .punctuation.md,
.ordered.list.markup.md .link.markup.md .punctuation.md {
  margin-left: 0;
}
.unordered.list.markup.md .label.link.string.md .punctuation.md,
.ordered.list.markup.md .label.link.string.md .punctuation.md {
  margin-left: 0;
}
.unordered.list.markup.md,
.ordered.list.markup.md {
  margin-left: 5%;
}
.quote.markup.md {
  color: #009bc6;
  background-color: rgba(223, 235, 239, 0.5);
  padding: 1%;
  font-weight: 500;
  width: 100%;
}
.text.md .link.markup.md .text.link.string.md,
.image.link.string.md {
  color: #009bc6;
}
.text.md .link.markup.md .destination.link.md {
  color: #c5c8c6;
}
.text.md .invalid.illegal.bad-ampersand {
  color: #656565;
  background-color: transparent;
}
.ft-handle:before {
  color: #009bc6;
}
.comment.critic.markup.md {
  color: #0117b8;
}
.addition.critic.markup.md {
  color: #00cc00;
}
.deletion.critic.markup.md {
  color: red;
}
.substitution.critic.markup.md {
  color: orange;
}
.highlight.critic.markup.md {
  color: purple;
}
